import React from "react";
import { Box, Flex, Image } from "rebass";

import "./Navbar.css";

function Navbar() {
  return (
    <Box p={5} fontSize={4} width={[1, 1, 1 / 2]} color="black" bg="primary">
      About Us Ways To Give Found an Animal? News & Events Store
    </Box>
  );
}

export default Navbar;
